import styles from './Proper.module.scss';
import { Link } from 'react-router-dom';
function Proper({data, avatar}) {

    return ( 
        <Link to={`/@${data.nickName}`} className={styles['row-menu']}>
            <img src={data.avatar} alt="" className={styles['avatar']}/>
            <div>
                <p className={styles['name']}>{data.name}</p>
                <h5 className={styles['nick-name']}>{data.name}</h5>
            </div>
        </Link>
     );
}

export default Proper;
